import React, { Component, Fragment } from 'react'
import { HeaderWrapper, Logo } from './style'

class Header extends Component {
  render () {
    return (
      <Fragment>
        <HeaderWrapper>
          <Logo />
          Header
        </HeaderWrapper>
      </Fragment>
    )
  }
}

export default Header
